DELIMITER //
CREATE PROCEDURE `GetStudentDetailsAndDecision`(IN S_StudentID INT)
BEGIN
    -- Retrieve student details and decision for the given application ID
    SELECT
        SC.*,
        D.School_Decision,
        D.Student_Decision
    FROM
        mm_team01_02.Student AS S
    JOIN
        mm_team01_02.Application AS A ON S.StudentID = A.StudentID
    LEFT JOIN
        mm_team01_02.Decision AS D ON S.StudentID = D.StudentID AND A.ApplicationID = D.ApplicationID
	JOIN 
		mm_team01_02.Application_to_Program AS AP ON AP.ApplicationID = A.ApplicationID
	JOIN
		mm_team01_02.Program AS P ON P.ProgramID = AP.ProgramID
	JOIN
		mm_team01_02.Department AS DP ON DP.DepartmentID = P.DepartmentID
	JOIN
		mm_team01_02.School AS SC ON SC.SchoolID = DP.SchoolID
    WHERE
        S.StudentID = S_StudentID;
END //
